import React from "react";
import Row from "react-bootstrap/Row";

const SingleData = (props) => {
  return (
    <div>
      <Row
        style={{
          margin: "auto",
          borderBottom: "0.5px solid #c2c2c2",
          background: "rgba(27, 38, 83, 0.22)",
          marginTop: "3%",
        }}
      >
        <h4>{props.date}</h4>
        <h4>{props.value}</h4>
      </Row>
    </div>
  );
};

export default SingleData;
